import React from 'react'

import '../Styles/Project.scss'

const Project = ({ url }) => {
  return (
      <div className='project-item'>
        <img src={url} alt='project-item__pic'/>   
        <div className="project-item__background">1111111111111</div>
      </div>
  )
}

export default Project
